import React from "react";
import {data} from "../helper/data";
// console.log(data);

const PlayerCard = () => {
 
//   console.log(a);
  return 
 ( <div>
{
    data.map((item)=>(
        <div key={item.name}>
            <img src={item.img} alt="" />
            <h1>{item.name}</h1>
            <h2>{item.statistics}</h2>
        </div>
    ))
}
  </div>);
};

export default PlayerCard;
